	add("surcease", "{\"term\":\"surcease\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman {{m|fro|surseser}}, from Old french (842-ca. 1400) {{m|fro|sursis}}, past participle of {{m|fro|surseoir}}, from Latin {{m|la|supersedere}}. Spelling later influenced by association with unrelated \u0027cease\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Cessation; stop; end\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Longfello\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Not desire, but its \u0027\u0027surcease\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Francis Baco\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"It is time that there were an end and \u0027\u0027surcease\u0027\u0027 made of this immodest and deformed manner of writing\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1970\u0027\u0027, Alvin Toffler, \u0027Future Shock\u0027, \u0027Bantam Books\u0027, pg. 217\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"For the individual who wishes to live in his time, to be a part of the future, the super-industrial revolution offers no \u0027\u0027surcease\u0027\u0027 from change\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1845\u0027\u0027, Edgar Allan Poe, \u0026quot;\u0026quot\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Ah, distinctly I remember it was in the bleak December,\u0026lt;br\u0026gt;And each separate dying ember wrought its ghost upon the floor.\u0026lt;br\u0026gt;Eagerly I wished the morrow; \u0026amp;mdash; vainly I had sought to borrow\u0026lt;br\u0026gt;From my books \u0027\u0027surcease\u0027\u0027 of sorrow \u0026amp;mdash; sorrow for the lost Lenore \u0026amp;mdash;\u0026lt;br\u0026gt;For the rare and radiant maiden whom the angels named Lenore \u0026amp;mdash;\u0026lt;br\u0026gt;Nameless here for evermore\", \"priority\":9}]}, \"synonyms\":{}}");

	add("surcharge", "{\"term\":\"surcharge\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027surcharge\u0027 from Old french (842-ca. 1400) Surface etymology is {{prefix|sur|charge|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An addition of extra charge on the agreed or stated price\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Our airline tickets cost twenty dollars more than we expected because we had to pay a fuel \u0027\u0027surcharge\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An excessive price charged e.g. to an unsuspecting customer\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An overprint on a stamp that alters (usually raises) the original nominal value of the stamp; used especially in times of hyperinflation\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A charge that has been omitted from an account as payment of a credit to the charged party\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A penalty for failure to exercise common prudence and skill in the performance of a fiduciary\u0027s duties\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An excessive load or burden\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Francis Baco\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A numerous nobility causeth poverty and inconvenience in a state, for it is \u0027\u0027surcharge\u0027\u0027 of expense\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The putting, by a commoner, of more animals on the common than he is entitled to\", \"priority\":10}]}, \"synonyms\":{}}");

