	add("suretyship", "{\"term\":\"suretyship\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|surety|ship|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An accessory agreement through which a person binds themselves for another already bound, either in whole or in part, as for their debt, default or miscarriage; the assumption of liability for the obligations of another\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"vol.1, New York Review of Books, 2001, p.290\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"as a man desperately swimming drowns him that comes to help him, by \u0027\u0027suretyship\u0027\u0027 and borrowing they will willingly undo all their associates and allies\u0026amp;nbsp;[…\", \"priority\":3}]}, \"synonyms\":{}}");

	add("surface", "{\"term\":\"surface\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"{{wikipedia}}From French French|surface\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Image:Saddle thumb|A computer-generated representation of a surfac\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The overside or up-side of a flat object such as a table, or of a liquid\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003dForeword|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dA very neat old woman, still in her good outdoor coat and best beehive hat, was sitting at a polished mahogany table on whose \u0027\u0027surface\u0027\u0027 there were several scored scratches so deep that a triangular piece of the veneer had come cleanly away\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The outside hull of a tangible object\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/science-and-technology/21577341-worlds-third-largest-area-ice-about-undergo-systematic The climate of Tibet: passage\u003dOf all the transitions brought about on the Earth’s \u0027\u0027surface\u0027\u0027 by temperature change, the melting of ice into water is the starkest. It is binary. And for the land beneath, the air above and the life around, it changes everything\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/science-and-technology/21581981-what-pollution-some-opportunity-others-welcome-plastisphere Welcome to the passage\u003d[The researchers] noticed many of their pieces of [plastic marine] debris sported \u0027\u0027surface\u0027\u0027 pits around two microns across.}} \u0026lt;!-- Is this an example of adjectival use ??? Attributive maybe? short for \u0027pits on the surface--\u0026gt\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Outward or external appearance\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1752-1821\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Vain and weak understandings, which penetrate no deeper than the \u0027\u0027surface\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"“A tight little craft,” was Austin’s invariable comment on the matron; and she looked it, always trim and trig and smooth of \u0027\u0027surface\u0027\u0027 like a converted yacht cleared for action. \u0026amp;para; Near her wandered her husband, orientally bland, invariably affable\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The locus of an equation (especially one with exactly two degree of degrees of freedom) in a more-than-two-dimensional space\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"That part of the side which is terminated by the flank prolonged, and the angle of the nearest bastion\", \"priority\":12}]}, \"synonyms\":{\"list\":[{\"text\":\"superfice\", \"synonymQualifier\":\"ARCHAIC\"}]}}");

