	add("surfeit", "{\"term\":\"surfeit\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027sorfet\u0027 past participle of \u0027lang\u003dfro|surfaire\u0027 () from \u0027lang\u003dfro\u0027 + \u0027lang\u003dfro|faire\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An excessive amount of something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027surfeit\u0027\u0027 of wheat is driving down the price\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Overindulgence in either food or drink; overeating\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Now comes the sick hour that his \u0027\u0027surfeit\u0027\u0027 made\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"And take heed to yourselves, lest at any time your hearts be overcharged with \u0027\u0027surfeiting\u0027\u0027, and drunkenness, and cares of this life, and so that day come upon you unawares\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A sickness or condition caused by overindulgence\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"King Henry I is said to have died of a \u0027\u0027surfeit\u0027\u0027 of lampreys\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Bunya\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"to prevent \u0027\u0027surfeit\u0027\u0027 and other diseases that are incident to those that heat their blood by travel\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Disgust caused by excess; satiety\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Matter and argument have been supplied abundantly, and even to \u0027\u0027surfeit\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Sir Philip Sidne\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Now for similitudes in certain printed discourses, I think all herbalists, all stories of beasts, fowls, and fishes are rifled up, that they may come in multitudes to wait upon any of our conceits, which certainly is as absurd a \u0027\u0027surfeit\u0027\u0027 to the ears as is possible\", \"priority\":14}]}, \"synonyms\":{}}");

