	add("surgeon", "{\"term\":\"surgeon\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027surgien\u0027 \u0027sirogen\u0027 (Old French \u0027surgien\u0027 et al.), from a derivative of Latin \u0027chīrūrgia\u0027 (surgery) from {{m|la|chīrurgus||surgeon}}, from Ancient greek (to 1453) \u0027χείρ\u0027 (hand) + \u0027ἔργον\u0027 (work)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who performs surgery; a doctor who performs operations on people or animals\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027surgeon\u0027\u0027 refused to operate because the patient was her son\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A surgeonfish\", \"priority\":3}]}, \"synonyms\":{}}");

	add("surgery", "{\"term\":\"surgery\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027surgerie\u0027 contracted form of \u0027cirurgie\u0027 from Latin \u0027lang\u003dla\u0027 from Ancient greek (to 1453) \u0027χειρουργία\u0027 from \u0027χείρ\u0027 (hand) + \u0027ἔργον\u0027 (work)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A procedure involving major incisions to remove, repair, or replace a part of a body\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Many times \u0027\u0027surgery\u0027\u0027 is necessary to prevent cancer from spreading\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The medical specialty related to the performance of surgical procedures\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A room or department where surgery is performed\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, \u0027The Devil\u0027s Doctor\u0027, Arrow 2007, p. 51\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The physician\u0027s proper place was in the library, not in the \u0027\u0027surgery\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A doctor\u0027s consulting room\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"I dropped in on the \u0027\u0027surgery\u0027\u0027 as I was passing to show the doctor my hemorrhoids\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Any arrangement where people arrive and wait for an interview with certain people, similar to a doctor\u0027s surgery\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Our MP will be holding a \u0027\u0027surgery\u0027\u0027 in the village hall on Tuesday\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A pre-packaged bankruptcy or \u0026quot;quick bankruptcy\u0026quot\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The production of a manifold by removing parts of one manifold and replacing them with corresponding parts of others\", \"priority\":12}]}, \"synonyms\":{}}");

	add("surgiholic", "{\"term\":\"surgiholic\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|surgery|holic|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person motivated to repeatedly undergo cosmetic surgery\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, Roger Kohn, \u0027Textbook of Ophthalmic Plastic and Reconstructive Surgery\u0027, Lea \u0026amp; Febiger (1988), ISBN 9780812111125, page 189\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Surgery should be avoided when the deformity is minimal, particularly in patients with a \u0026quot;\u0027\u0027surgiholic\u0027\u0027\u0026quot; tendency\", \"priority\":3}]}, \"synonyms\":{}}");

