	add("surjection", "{\"term\":\"surjection\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027lang\u003dfr\u0027 introduced by {{w|Nicolas Bourbaki}} in his treatise \u0027Éléments de mathématique\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A function of \u0026quot;many-to-one\u0026quot; mapping relationship; more formally, \u0027f\u0027:\u0026amp;nbsp;\u0027X\u0027\u0026amp;nbsp;\u0026amp;rarr;\u0026amp;nbsp;\u0027Y\u0027 is a surjection if and only if, for every \u0027y\u0027 in the codomain \u0027Y\u0027, there is at least one \u0027x\u0027 in the domain \u0027X\u0027 with \u0027f\u0027(\u0027x\u0027)\u0026amp;nbsp;\u003d\u0026amp;nbsp;\u0027y\", \"priority\":1}]}, \"synonyms\":{}}");

	add("surmise", "{\"term\":\"surmise\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027surmis\u0027 past participle of \u0027surmetre\u0027 from \u0027sur-\u0027 (upon) + \u0027metre\u0027 (to put)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Thought, imagination, or conjecture, which may be based upon feeble or scanty evidence; suspicion; guess\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"surmises\u0027\u0027 of jealousy or of envy\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Jonathan Swif\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"No man ought to be charged with principles he actually disowns, unless his practices contradict his profession; not upon small \u0027\u0027surmises\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1919\u0027\u0027, w:William Somerset W. Somerset Maugham, \u0027w:The Moon and The Moon and Sixpence\u0027, s:The Moon and Sixpence/Chapter chapter 3\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The meeting had been devoid of incident. No word had been said to give me anything to think about, and any \u0027\u0027surmises\u0027\u0027 I might make were unwarranted. I was intrigued\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Reflection; thought; posit\", \"priority\":7}]}, \"synonyms\":{}}");

	add("surmiser", "{\"term\":\"surmiser\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|surmise|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who surmises\", \"priority\":1}]}, \"synonyms\":{}}");

	add("surplice", "{\"term\":\"surplice\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027surpeliz\u0027 from \u0027superpelliceum\u0027 from Latin \u0027super\u0027 (over) and \u0027pellis\u0027 (fur)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A liturgical vestment of the Christian Church. It has the form of a tunic of white linen or cotton material, with wide or moderately wide sleeves, reaching to the hips or knees. It usually features lace decoration and may have embroidered bordures\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dThen everybody once more knelt, and soon the blessing was pronounced. The choir and the clergy trooped out slowly, [\u0026amp;hellip;], down the nave to the western door. [\u0026amp;hellip;] At a seemingly immense distance the \u0027\u0027surplice\u0027\u0027d group stopped to say the last prayer\", \"priority\":2}]}, \"synonyms\":{}}");

	add("surprise", "{\"term\":\"surprise\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) {{m|enm|surprise}}, from Middle french (ca. 1400-1600) {{m|frm|surprise||an overtake}}, nominal use of the past participle of Old french (842-ca. 1400) {{m|fro|sorprendre||to overtake}}, from {{m|fro|sor-||over}} + {{m|fro|prendre||to take}}, from Latin {{m|la|prendere}}, contracted from {{m|la|prehendere||to grasp, seize}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something not expected\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Daniel Taylor, \u0027Rickie Lambert’s debut goal gives England victory over Scotland\u0027 (in \u0027The Guardian\u0027, 14 August 2013)[http://www.theguardian.com/football/2013/aug/14/england-scotland-international-friendly\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"They had begun brightly but the opening goal was such a blow to their confidence it almost came as a \u0027\u0027surprise\u0027\u0027 when Walcott, running through the inside-right channel, beat the offside trap and, checking back on to his left foot, turned a low shot beyond Allan McGregor in the Scotland goal\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Unexpected\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The feeling that something unexpected has happened\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d20|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dThe story struck the depressingly familiar note with which true stories ring in the tried ears of experienced policemen.The second note, the high alarum, not so familiar and always important since it indicates the paramount sin in Man’s private calendar, took most of them by \u0027\u0027surprise\u0027\u0027 although they had been well prepared\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A dish covered with a crust of raised pastry, but with no other contents\", \"priority\":7}]}, \"synonyms\":{}}");

	add("surra", "{\"term\":\"surra\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From a Marathi word, imitative of heavy breathing through the nostrils.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A disease of vertebrate animals caused by protozoan trypanosomes, involving fever, weakness, and lethargy\", \"priority\":1}]}, \"synonyms\":{}}");

