	add("surrealism", "{\"term\":\"surrealism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027surréalisme\u0027 {{prefix|sur|realism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An artistic movement and an aesthetic philosophy that aims for the liberation of the mind by emphasizing the critical and imaginative powers of the subconscious\", \"priority\":1}]}, \"synonyms\":{}}");

	add("surreality", "{\"term\":\"surreality\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027surréalité\u0027 equivalent to {{suffix|surreal|ity|lang\u003den|nocat\u003d1}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being incongruous or surreal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027surreality\u0027\u0027 of the crash scene dawned upon him only when he saw a holy figure in the smoke\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"That which is surreal; a surreal entity, event or other fact\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027surreality\u0027\u0027 of life are the paradoxes thereof\", \"priority\":4}]}, \"synonyms\":{}}");

	add("surrogate", "{\"term\":\"surrogate\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027surrogatus\u0027 perfect passive participle of \u0027surrogare\u0027 (ask) a variant of \u0027subrogare\u0027 from \u0027sub\u0027 () + \u0027rogare\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A substitute (usually of a person, position or role\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person or animal that acts as a substitute for the social or pastoral role of another, such as a surrogate mother\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A deputy for a bishop in granting licences for marriage\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A judicial officer of limited jurisdiction, who administers matters of probate and intestate succession and, in some cases, adoptions\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A \u0027surrogate\u0027 or \u0027surrogate key\u0027 is a unique identifier for either an entity in the modeled world or an object in the database\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Any of a range of Unicode codepoints which are used in pairs in UTF-16 to represent characters beyond the Basic Multilingual Plane\", \"priority\":6}]}, \"synonyms\":{}}");

	add("surroundings", "{\"term\":\"surroundings\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the area surrounding someone or something, together with the objects and circumstances in the vicinity; the environment or ambianc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"All parts of the universe that are not within the thermodynamic system of interest\", \"priority\":2}]}, \"synonyms\":{}}");

	add("surtext", "{\"term\":\"surtext\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|surface|text|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The explicit or surface meaning of a literary text, as opposed to the subtext\", \"priority\":1}]}, \"synonyms\":{}}");

	add("surtout", "{\"term\":\"surtout\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027surtout\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A man\u0027s overcoat\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, \u0027Water Music\u0027, Penguin 2006, p. 41\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He was dressed in the suit he\u0027d bought for his mother\u0027s funeral, beaver top hat, silk \u0027\u0027surtout\", \"priority\":3}]}, \"synonyms\":{}}");

	add("survey", "{\"term\":\"survey\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) {{m|enm|surveyen}}, from Old french (842-ca. 1400) \u0027sourveoir\u0027 \u0027surveer\u0027 from \u0027sour-\u0027 \u0027sur-\u0027 (over) + \u0027veoir\u0027 \u0027veeir\u0027 (to see) from Latin \u0027videre\u0027 See \u0027sur-\u0027 and \u0027vision\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of surveying; a general view, as from above\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Under his proud \u0027\u0027survey\u0027\u0027 the city lies\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A particular view; an examination, especially an official examination, of a particular group of items, in order to ascertain the condition, quantity, or quality\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027survey\u0027\u0027 of the stores of a ship; a \u0027\u0027survey\u0027\u0027 of roads and bridges; a \u0027\u0027survey\u0027\u0027 of buildings\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An examination of the opinions of a group of people\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The local council conducted a \u0027\u0027survey\u0027\u0027 of its residents to help it decide whether to go ahead with the roadside waste collection service\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A questionnaire or similar instrument used for examining the opinions of a group of people\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"I just filled out that \u0027\u0027survey\u0027\u0027 on roadside waste pick-up\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The operation of finding the contour, dimensions, position, or other particulars of any part of the earth\u0027s surface\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A measured plan and description of any portion of country\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The owners of the adjoining plots had conflicting \u0027\u0027surveys\", \"priority\":11}]}, \"synonyms\":{}}");

	add("surveyee", "{\"term\":\"surveyee\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|survey|ee|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who is subject to a survey\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Question 7 assessed the emotional response of the \u0027\u0027surveyees\u0027\u0027 to mathematics\", \"priority\":2}]}, \"synonyms\":{}}");

	add("surveying", "{\"term\":\"surveying\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|survey|ing|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The science of accurately determining the position of points and the distances between them\", \"priority\":1}]}, \"synonyms\":{}}");

	add("survival", "{\"term\":\"survival\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|survive|al|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The fact or act of surviving; continued existence or life\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"His \u0027\u0027survival\u0027\u0027 in the open ocean was a miracle; he had fully expected to die\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"as a modifier\u0027) Of, relating to or aiding survival\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"His \u0027\u0027survival\u0027\u0027 kit had all the things he needed in the wilderness\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The avoidance of relegation or demotion to a lower league or division\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Dan Goldstein, \u0027[http://books.google.co.uk/books?isbn\u003d1858285577 The Rough Guide to English Football: A Fans\u0027 Handbook 2000-2001\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"quot;...a team that have turned snatching relegation from the jaws of top-flight \u0027\u0027survival\u0027\u0027 into an art form...\u0026quot\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, w:Alan Alan Stubbs, \u0027How Football Saved My Life\u0027, page 139\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"quot;Before you know it, you find yourself flirting around the relegation places and the season becomes a battle for \u0027\u0027survival\u0027\u0027.\u0026quot\", \"priority\":9}]}, \"synonyms\":{}}");

	add("survivalism", "{\"term\":\"survivalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A belief, expressed by survivalists, in being prepared to survive disasters and cataclysms including the collapse of civilization.Category:English words suffixed with -ism\", \"priority\":1}]}, \"synonyms\":{}}");

	add("survivor", "{\"term\":\"survivor\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who survives; one who endures through disaster or hardship\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One who knew a specific decedent\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"She was from a large family and had many friends, so the funeral was crowded with mourning survivors\", \"priority\":3}]}, \"synonyms\":{}}");

